import { IonBadge, IonButton, IonButtons, IonCol, IonContent, IonGrid, IonHeader, IonIcon, IonImg, IonLabel, IonPage, IonRouterLink, IonRouterOutlet, IonRow, IonSegment, IonSegmentButton, IonTab, IonTabBar, IonTabButton, IonTabs, IonText, IonTitle, IonToolbar } from '@ionic/react';
import React, { useState } from 'react';

import "../css/Global.css";
import "../css/ProgrammeTalks.css";
import TopNav from '../components/TopNav';
import { calendar, personCircle, map, informationCircle } from 'ionicons/icons';
import { Redirect, Route } from 'react-router';
import Tab1 from '../components/Tab1';

const ProgrammeTalksTab: React.FC = () => {

    // const [dayNum, setDayNum] = useState('day1');

    // const handleClick = () => {
    //     setDayNum('day1');
    // }

    // const handleClick2 = () => {
    //     setDayNum('day2');
    // }

    return (
        <IonPage>
            <TopNav title="Programme Talks" route='/u/openHouseMain' backarrow={ true } hamburger = { true }/>

            <IonContent>
                <IonTabs>
                    <IonRouterOutlet>
                        <Route path="/:tab(tab1)" component={Tab1} exact={true} />
                        <Route path="/:tab(tab2)" component={Tab2} />
                        <Route path="/" render={() => <Redirect to="/tab1" />} /> 
                    </IonRouterOutlet>

                    <IonTabBar slot="top">
                        <IonTabButton tab="tab1" href="/tab1">
                            <IonIcon name="flash" />
                            <IonLabel>Tab One</IonLabel>
                        </IonTabButton>

                        <IonTabButton tab="tab2" href="/tab2">
                            <IonIcon name="apps" />
                            <IonLabel>Tab Two</IonLabel>
                        </IonTabButton>
                    </IonTabBar>
                </IonTabs>
            </IonContent>
        </IonPage>
    );
};

export default ProgrammeTalksTab;
